/// Check if a tag is writable
pub fn is_tag_writable(tag_name: &str) -> bool {
    WRITABLE_TAGS.contains_key(tag_name)
}

/// Get writable tag information
pub fn get_writable_tag_info(tag_name: &str) -> Option<&WritableTagInfo> {
    WRITABLE_TAGS.get(tag_name)
}

/// Get tag safety level
pub fn get_tag_safety_level(tag_name: &str) -> Option<&SafetyLevel> {
    WRITABLE_TAGS.get(tag_name).map(|info| &info.safety_level)
}

/// Get all writable tags by safety level
pub fn get_tags_by_safety_level(level: &SafetyLevel) -> Vec<&WritableTagInfo> {
    WRITABLE_TAGS.values().filter(|tag| tag.safety_level == *level).collect()
}

/// Get writable tags count
pub fn get_writable_tags_count() -> usize {
    WRITABLE_TAGS.len()
}
